import Link from 'next/link';
import Header from '../components/Header'

const Index = () => (
    <div>
        <Header />
        <Link href='/about'>
            <a>About Page</a>
        </Link>
        <p>Hello Next.js</p>
        <h1>How are you?</h1>
    </div>
);

export default Index;
